import React from 'react';
import { Card, Button, Container, Row, Col } from 'react-bootstrap';

const products = [
  {
    id: 1,
    name: 'Product 1',
    price: '$19.99',
    description: 'This is a short description of product 1.',
    image: 'https://encrypted-tbn3.gstatic.com/shopping?q=tbn:ANd9GcRcQIwLDtIBunZotNtEd4UPe2KgeZvySFknn1EfTziQTmbvl13WYiCQ5lBxS0yqQnwawWR10yeoXikGenRNULZTMJO0AAJ8Gu_mAdu-da1QfBRhKRq7Z6Xp8KP5v-H61THvvAXzBA&usqp=CAc'
  },
  {
    id: 2,
    name: 'Product 2',
    price: '$29.99',
    description: 'This is a short description of product 2.',
    image: 'https://cdn11.bigcommerhttps://www.kukkaflowers.com/cdn/shop/products/Lush_Blush_Bridal_Bouquet_460x.jpg?v=1640649377ce.com/s-lzx6le/images/stencil/1280x1280/products/1241/2902/167398L__04164.1557610883.jpg?c=2'
  },
  {
    id: 3,
    name: 'Product 3',
    price: '$39.99',
    description: 'This is a short description of product 3.',
    image: 'https://encrypted-tbn3.gstatic.com/shopping?q=tbn:ANd9GcQwGQhyzwCekeF4AzFmyVqDyUcm6DFfvhC-_5pUwQWfylkFQWiTWEoGaVt9Tgbj-ESPYEKTOlVH4Rxrkfhh7pBvm2EotCiL'
  }
];

const WedProducts = () => {
  return (
    <Container>
      <Row>
        {products.map((product) => (
          <Col key={product.id} sm={12} md={6} lg={4} className="mb-4">
            <Card>
              <Card.Img variant="top" src={product.image} />
              <Card.Body>
                <Card.Title>{product.name}</Card.Title>
                <Card.Text>{product.description}</Card.Text>
                <Card.Text>{product.price}</Card.Text>
                <Button variant="primary">Add to Cart</Button>
              </Card.Body>
            </Card>
          </Col>
        ))}
      </Row>
    </Container>
  );
};

export default WedProducts;
